import React, {useState, useEffect} from 'react';
import TabNav from "./components/TabNav.js";
import Header from "./components/Header.js";
import { Card, Image } from 'semantic-ui-react'
import {BrowserRouter as Router, Route, Link} from 'react-router-dom'
import {Button} from 'reactstrap'
import axios from 'axios'
import {EpisodeList} from './components/Episodes/EpisodeList'
import WelcomePage from './components/WelcomePage.js';




export default function App() {


  return (
    <div className="App">
    {/*Rendering our path to the home component. The route tells our program what components are going to render.*/}
      <nav>
        <Button className="nav-button">
          <Link to="/">Home</Link>
        </Button>

        <Button className="nav-button">
          <Link to="/character-list">Characters</Link>
        </Button>

        <Button className="nav-button">
          <Link to="/locations-list">Locations</Link>
        </Button>

        <Button className="nav-button">
          <Link to="/episode-list">Episodes</Link>
        </Button>
      </nav>
   <br />
    <Route exact path="/" component={WelcomePage} />
    <Route 
      path="/character-list" 
      render={(props) => <Characters 
                          {...props} 
                          characters={characters}
                          setCharacters={setCharacters} />} />

    <Route 
      path="/locations-list" 
      render={(props) => <Locations 
                          {...props} 
                          locations={locations}
                          setLocations={setLocations} />} />

    <Route 
      path="/episode-list" 
      render={(props) => <Episodes 
                          {...props} 
                          episodes={episodes}
                          setEpisodes={setEpisodes}/>} />




    </div>
  );
}
